    "# Calculate the height of the aspect ratio\n",
    "\n",
    "top_left <- st_point(c(bb[[\"xmin\"]], bb[[\"ymax\"]])) |> \n",
    "  st_sfc(crs = st_crs(data))\n",
    "\n",
    "height <- st_distance(bottom_left, top_left)\n",
    "height"
   ]
