    "# handle conditions of width or height being the longer side\n",
    "\n",
    "if (width > height) {\n",
    "  w_ratio <- 1\n",
    "  h_ratio <- height / width\n",
    "} else {\n",
    "  h_ration <- 1\n",
    "  w_ratio <- width / height\n",
    "}"
