   "source": [
    "# create color palette\n",
    "pal <- \"day_night\"\n",
    "\n",
    "night <- \"#4e82b4\"\n",
    "day <- \"#fff5b6\"\n",
    "    \n",
    "  \n",
    "colors <- c(night, day, \"white\")\n",
    "swatchplot(colors)\n",
    "  \n",
    "texture <- grDevices::colorRampPalette(colors, bias = 3)(256)\n",
    "swatchplot(texture)"
   ]
  },
